import Link from 'next/link';

const AppLayout = ({ children }) => {
    return (
        <div>
            <div>
            <Link href="/"><a>공통메뉴</a></Link>
            <Link href="/profile"><a>공통메뉴</a></Link>
            <Link href="/signup"><a>공통메뉴</a></Link>
            </div>
            {children}
        </div>
    );
};

AppLayout.propTypes = {
    children: PropTypes.node.inRequired,
};

export default AppLayout;
